import img from '../Assets/image.png';
function App() {
    return (
      <div className="App w-[100vw] h-[45vh] flex items-center gap-[1vh] justify-center  overflow-y-auto bordertest">
            <div className='w-full h-[25vh] bordertest footerdesc'></div>
            <div className='w-full h-[5vh] bordertest footerdesc'></div>
            <div className='w-full h-[5vh] bordertest footerdesc'></div>
      </div>
    );
  }
  
export default App;
